def convert(nums):
    ints = {"zero":0,"one":1,"two":2,"three":3,"four":4,"five":5,"six":6,"seven":7,"eight":8,"nine":9}
    nums = list(nums.lower())
    answer = ""
    first = {"z": "zero",
             "w": "two",
             "x": "six",
             "g": "eight",
             "u": "four"}
    
    for i in first.keys():
        while (i in nums):
            answer += str(ints[first[i]])
            for j in first[i]:
                nums.remove(j)
    
    second = {"o" : "one",
              "t" : "three",
              "f" : "five",
              "s" : "seven"}
    
    for i in second.keys():
        while (i in nums):
            answer += str(ints[second[i]])
            for j in second[i]:
                nums.remove(j)
    for i in nums:
        if i=="i":
            answer += "9"
    
    return("".join(sorted(answer)))
